import { IconButton } from "@chakra-ui/button";
import { Flex, VStack, Heading } from "@chakra-ui/react";
import { FanSun, FaMoon, FaGithub, FaLinkedin} from 'react-icons/fa'
function App() {
  return (
    <div className="App">
      <VStack p={5}>
        <Flex w="100%">
        <Heading
        ml="8" size="md" fontWeight="semibold" color="cyan.400"
         >
         iamlakshya
        </Heading>
        </Flex>
        <iconButton icon={<FanSun />} isRound="true"></iconButton>
      </VStack>
    </div>
  );
}

export default App;
